import React from 'react';
import Button from '@mui/material/Button';
import  Field  from './Field';
import  Links  from './Links';
import  Box  from '@mui/material/Box';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';



export default  class Forms extends React.Component{
    render()
    {
      return(
        <Box
        sx={{
            marginTop: 'auto',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Box
          component="form" noValidate sx={{ mt: 1 }}
          >
            <div>
              <Field name='username' label='Username' type='text'/>
              <Field name='passsword' label='Password' type='password'/>
              <Links text="Forgot your passwords" underline="none" color='blue'/>
              <ButtonUsage/>
            </div>
          </Box>
        </Box>
      )
    }
  }

  class ButtonUsage extends React.Component{
    constructor(props){
      super(props)
    }
    render()
    {
      return(
        <div>
          <Button variant="contained" color='primary'>Login</Button>
        </div>

      )
    }
  }

